import React, { useState, useEffect } from 'react';
import { 
  Container, 
  Typography, 
  IconButton, 
  Button, 
  Card,
  CardContent,
  Grid,
  Box,
  CardMedia,
  Divider,
  Paper,
  Badge
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import LocalDiningIcon from '@mui/icons-material/LocalDining';
import axios from 'axios';

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [total, setTotal] = useState(0);

  useEffect(() => {
    fetchCart();
  }, []);

  const fetchCart = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/cart', {
        headers: { Authorization: `Bearer ${token}` }
      });
      
      setCartItems(response.data.items || []);
      calculateTotal(response.data.items || []);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching cart:', error);
      setError('Error loading cart');
      setLoading(false);
    }
  };

  const calculateTotal = (items) => {
    const sum = items.reduce((acc, cartItem) => {
      return acc + (cartItem.item?.price || 0) * cartItem.quantity;
    }, 0);
    setTotal(sum);
  };

  const handleRemoveItem = async (itemId) => {
    try {
      const token = localStorage.getItem('token');
      await axios.delete(`http://localhost:5000/cart/${itemId}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      fetchCart();
    } catch (error) {
      console.error('Error removing item:', error);
      alert('Error removing item from cart');
    }
  };

  if (loading) return (
    <Box display="flex" justifyContent="center" alignItems="center" height="60vh">
      <Typography variant="h6">Loading your cart...</Typography>
    </Box>
  );

  if (error) return (
    <Box display="flex" justifyContent="center" alignItems="center" height="60vh">
      <Typography color="error" variant="h6">{error}</Typography>
    </Box>
  );

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Paper elevation={0} sx={{ p: 3, backgroundColor: 'transparent' }}>
        <Typography variant="h4" gutterBottom sx={{ 
          display: 'flex', 
          alignItems: 'center',
          color: 'primary.main',
          mb: 4 
        }}>
          <ShoppingCartIcon sx={{ mr: 2 }} />
          Your Cart
          <Badge 
            badgeContent={cartItems.length} 
            color="secondary" 
            sx={{ ml: 2 }}
          />
        </Typography>

        {cartItems.length === 0 ? (
          <Box 
            display="flex" 
            flexDirection="column" 
            alignItems="center" 
            py={8}
          >
            <LocalDiningIcon sx={{ fontSize: 60, color: 'text.secondary', mb: 2 }} />
            <Typography variant="h6" color="text.secondary">
              Your cart is empty
            </Typography>
            <Button 
              variant="contained" 
              color="primary" 
              sx={{ mt: 2 }}
              href="/products"
            >
              Browse Products
            </Button>
          </Box>
        ) : (
          <Grid container spacing={4}>
            <Grid item xs={12} md={8}>
              {cartItems.map((cartItem) => (
                <Card 
                  key={cartItem._id} 
                  sx={{ 
                    mb: 2, 
                    transition: '0.3s',
                    '&:hover': {
                      transform: 'translateY(-4px)',
                      boxShadow: 3
                    }
                  }}
                >
                  <CardContent>
                    <Grid container alignItems="center" spacing={3}>
                      <Grid item xs={12} sm={3}>
                        {cartItem.item?.image && (
                          <CardMedia
                            component="img"
                            height="120"
                            image={cartItem.item.image}
                            alt={cartItem.item?.name}
                            sx={{ borderRadius: 1, objectFit: 'cover' }}
                          />
                        )}
                      </Grid>
                      <Grid item xs={12} sm={5}>
                        <Typography variant="h6" gutterBottom>
                          {cartItem.item?.name || 'Loading...'}
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                          Quantity: {cartItem.quantity}
                        </Typography>
                        {cartItem.item?.category && (
                          <Typography variant="body2" color="text.secondary">
                            Category: {cartItem.item.category}
                          </Typography>
                        )}
                      </Grid>
                      <Grid item xs={12} sm={3}>
                        <Typography variant="h6" color="primary">
                          ₹{((cartItem.item?.price || 0) * cartItem.quantity).toFixed(2)}
                        </Typography>
                      </Grid>
                      <Grid item xs={12} sm={1}>
                        <IconButton 
                          onClick={() => handleRemoveItem(cartItem._id)}
                          color="error"
                          size="large"
                        >
                          <DeleteIcon />
                        </IconButton>
                      </Grid>
                    </Grid>
                  </CardContent>
                </Card>
              ))}
            </Grid>

            <Grid item xs={12} md={4}>
              <Card sx={{ position: 'sticky', top: 20 }}>
                <CardContent>
                  <Typography variant="h5" gutterBottom>
                    Order Summary
                  </Typography>
                  <Divider sx={{ my: 2 }} />
                  <Box sx={{ mb: 2 }}>
                    <Grid container justifyContent="space-between">
                      <Typography variant="body1">Subtotal</Typography>
                      <Typography variant="body1">₹{total.toFixed(2)}</Typography>
                    </Grid>
                    <Grid container justifyContent="space-between">
                      <Typography variant="body2" color="text.secondary">
                        Delivery Fee
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        ₹50.00
                      </Typography>
                    </Grid>
                  </Box>
                  <Divider sx={{ my: 2 }} />
                  <Grid container justifyContent="space-between">
                    <Typography variant="h6">Total</Typography>
                    <Typography variant="h6">₹{(total + 50).toFixed(2)}</Typography>
                  </Grid>
                  <Button
                    variant="contained"
                    color="primary"
                    fullWidth
                    size="large"
                    sx={{ mt: 3 }}
                    onClick={() => alert('Checkout functionality coming soon!')}
                  >
                    Proceed to Checkout
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        )}
      </Paper>
    </Container>
  );
};

export default Cart;
